INSERT INTO public.sender (id, sender_name, sender_information, sender_schedule, fallback_url, example_interactions, alert_phone_number, sender_email) VALUES (3, 'Clay Middleton', 'A native Charlestonian, Clay grew up in Bayside Manor, now Bridgeview Village Apartments. He is running for Mayor of Charleston. Clay graduated from the Charleston Catholic School and Burke High School, where he served as Student Body President and Regimental Commander of Burke JROTC program his senior year. He was also honored with a Proclamation from the City of Charleston, declaring April 30, 1999 Clay N. Middletons Day. Clay matriculated to The Citadel - The Military College of South Carolina in 1999. While at The Citadel, he joined the SC Army National Guard as a Private First Class on January 6, 2000. Upon graduating in 2003, with a degree in political science, he was commissioned as a Second Lieutenant Signal Officer. Clay is currently a Lieutenant Colonel serving as a Battalion Commander. He is a graduate of the United States Army Command and General Staff College and the Reserve Component National Security Course at the National Defense University. In addition to his combat and operational experiences during Operation Iraqi Freedom, Operation Jump Start, and Operation Atlantic Resolve, Clay has supported a number of federal and state missions and served on the SC National Guard Association Executive Council. He is a recipient of the Bronze Star Medal, Meritorious Service Medal, four Army Commendation Medals, Army Achievement Medal, two Army Reserve Components Achievement Medals, National Defense Service Medal, Army Service Ribbon, Overseas Ribbon, Armed Forces Reserve Medal with M Device, Global War on Terrorism Service Medal, Iraq Campaign Medal, and Bronze Order of Mercury Award. Clay was appointed by President Barack Obama to serve as the associate and then acting director of the White House Office of Faith-Based and Neighborhood Partnerships at the Corporation for National and Community Service; he also served at the Department of Energy, and the National Nuclear Security Administration. In 2017, Clay became the Director of Business Services for the city of Charleston, where he led the Business & Neighborhood Services division. He is currently a Managing Director at Mercury Public Affairs, a global public strategic affairs firm. Clay served as a longtime aide to Congressman Jim Clyburn, and previously former Senator Fritz Hollings, and former SC Superintendent of Education Inez Tenenbaum. He also worked on the Biden-Harris Transition Team, for former Secretary of State Hillary Clinton, and Senator Cory Booker. His record of community and civic engagement speaks to Clays belief that to much is given, much is required. He is a member of The Citadel Alumni Association, the Charleston Alumni Chapter of Kappa Alpha Psi Fraternity, Inc, Gothic Lodge #212, F&AM, St. Luke R.E. Church, and the NAACP Charleston Chapter among others. Clay is also a Liberty Fellow with the Aspen Institute, a Riley Fellow with the Diversity Leaders Initiative, a Defense Council member with the Truman National Security Project, and SC Advisory Committee for the U.S. Global Leadership Coalition. Some of his other community service work is spent as a board member of the Climb Fund, Lowcountry Local First Policy & Advocacy Committee, Joseph P. Riley, Jr. Center for Livable Communities at the College of Charleston, and the Greater Charleston YWCA Harvey Gantt Triumph Award Selection Committee. A true believer in giving back, Clay, along with his wife Nicole, established the Clay and Nicole Middleton Family Fund at the Coastal Community Foundation to provide graduating high school students with need-based scholarships to further their education. Clay lives in West Ashley with his wife, Nicole, and their two energetic sons, Jeremiah and Joshua.', NULL, NULL, NULL, NULL, NULL);
INSERT INTO public.sender (id, sender_name, sender_information, sender_schedule, fallback_url, example_interactions, alert_phone_number, sender_email) VALUES (2, 'John Whitmire', 'Strong leadership and commitment to public service defines John Whitmire. He has spent his adult life working for Houstonians in our states Capitol, and now, John is running for Houston Mayor. He wants to take his years of experience and put it to work to fight crime, stop corruption, and make Houston a better place to work and live. John has represented a large portion of Houston and Harris County in Austin focusing on improving public safety, economic development, and ensuring government works for the people - not special interests. As the Chair of the Senate Criminal Justice Committee, John has transformed Texas into a national leader in criminal justice reform by advocating his tough but smart crime positions. Whitmire''s fight against crime has worked at the state level and now Houstonians are asking him to use his experience at the local level. John is known as a can do public servant. John often says Houston is not New York or Chicago  we are Houston. We can fix our problems. John is an active advocate for all our first responders, and John believes we must have the best fire and police departments in the country. Furthermore, John also advocates for small businesses in Houston and across Texas by championing policies that encourage economic growth. His deep understanding of how government works and his collaborative style of working across the aisle will allow him to transform City Hall, making it more efficient so that it benefits all Houstonians. Houston is a large metropolitan city and John believes we should continue to grow and respect our differences. Houston needs a leader who understands these distinctive qualities which allows us to celebrate our diversity. John Whitmire is the leader we need, and he needs your support in his run for the next Mayor of Houston. Lets go to work!', NULL, 'https://www.johnwhitmire.com/', '[ { Trigger: Result: Wrong Number, Body: Sorry about that! Thanks for letting me know, I''ll mark that now., Data Item: Result: Wrong Number }, { Trigger: Result: Moved, Body: No worries, you can still get involved even if you aren''t in Houston. Join us for a virtual phone bank by signing up here: mobilize.us/johnwhitmire/, Data Item: Result: Moved }, { Trigger: Support: Strong Whitmire, Body: Fantastic, thank you so much for your support! We''re thrilled to have you on the team. Can we count on you to help our campaign by sending texts, making calls or knocking on doors?, Data Item: 1 - Strong Support }, { Trigger: Support: Lean Whitmire , Body: Great! We''re thrilled to have you on the team. We''re committed to ampfying every voice in Houston, is there any issue that matters most to you?, Data Item: 2 - Lean Support }, { Trigger: Support: Undecided, Body: Okay--thanks for letting me know! I''m volunteering for John because he is committed to being tough but smart on crime, ensuring our basic city services like garabage pick up are met, continuing to diversity Houston''s economy and most importantly, bringing houston together. What issues matter most to you in the upcoming election? , Data Item: 3 - Undecided }, { Trigger: Support: Lean Against, Body: Okay--thanks for letting me know! I''m volunteering for John because he is committed to being tough but smart on crime, ensuring our basic city services like garabage pick up are met, continuing to diversity Houston''s economy and most importantly, bringing houston together. What issues matter most to you in the upcoming election? , Data Item: 4 - Lean Against }, { Trigger: Support: Strong Against, Body: Okay! Thanks for sharing that with me. We''re interested in connecting with people no matter who they''re supporting. When you think about the upcoming election, what issues are on your mind?, Data Item: 5 - Strong Against }, { Trigger: Not Voting, Body: Okay! Thanks for sharing that with me. We''re expecting unprecedented voter turnout this November, may I ask what''s keeping you from participating?, Data Item: Not Voting }, { Trigger: Needs to Register, Body: No worries, you still have time to get registered before the November 7th election, Visit https://www.harrisvotes.com/Voter/Registration to print a voter registration application. You must be registered by October 10th to vote!, Data Item: }, { Trigger: Volunteer: Send Texts, Body: Great! To get signed up to send texts, just click here:https://www.mobilize.us/johnwhitmire/event/570510/, Data Item: Volunteer: textbank }, { Trigger: Volunteer: Make Calls, Body: Great! To get signed up to make calls, just click here: https://www.mobilize.us/johnwhitmire/event/570468/, Data Item: Volunteer: Phonebank }, { Trigger: Volunteer: Never Send Texts, Body: No worries! You can always find ways to get involved with us by checking out this link: https://www.mobilize.us/johnwhitmire/, Data Item: Volunteer: Never Send Texts }, { Trigger: Volunteer: Never Make Calls, Body: No worries! You can always find ways to get involved with us by checking out this link: https://www.mobilize.us/johnwhitmire/, Data Item: Volunteer: Never Make Calls }, { Trigger: Volunteer: Later, Body: Okay! I''ll let the team know and we can ask you again at a later date, in the mean time stay up to date with our event by visiting mobilize.us/johnwhitmire/, Data Item: Volunteer: Later }, { Trigger: Wants to Donate, Body: Thanks for your support! To make a donation, just visit https://secure.anedot.com/john-whitmire-campaign/main, Data Item: Donor }, { Trigger: Result: Deceased, Body: I''m so sorry to hear that, our thoughts are with you and your family., Data Item: Result: deceased }, { Trigger: Temporary Opt Out, Body: I''ll ask the team to temporarily remove you from receiving texts, have a great rest of your day!, Data Item: Temp Opt Out }, { Trigger: Nonsense, Body: Im a volunteer looking to talk with voters about upcoming Houston Mayoral election. Id love to chat with you about the issues that you care about, but if youre not interested, then have a good day!, Data Item: }, { Trigger: Hostile, Body: I''m sorry, my intention wasn''t to start an argument or irritate you. Im just a volunteer looking to talk with voters about the upcoming Houston Mayoral election because I believe there is real change that needs to be made in our city. Id love to chat with you about the issues that you care about, but if youre not interested, then have a good day., Data Item: Result: Hostile }, { Trigger: Republican/Trump/MAGA, Body: Okay! Thanks for sharing that with me. Im just a fellow Houstonian who''s volunteering for John Whitmire''s campaign because I believe there is real change that needs to be made in our city, and we''re looking to talk to voters no matter what party they''re a member of. What issues are important to you in this cycle?, Data Item: }, { Trigger: Invasion of Privacy, Body: I''m sorry, my intention wasn''t to start an argument or irritate you. Believe it or not, most people prefer that we text them than knocking on their door or calling them! Im just a fellow Houstonian who''s volunteering for John Whitmire''s campaign because I believe there is real change that needs to be made in our city. If you''d like to talk about moving Houston forward, I''d love to hear what issues are important to you?, Data Item: }, { Trigger: Can''t Participate due to Hatch Act/Gov Employee, Body: Okay! Thanks for letting me know. Would you prefer I take you off of our list?, Data Item: }, { Trigger: I''m under 18, Body: Okay! Folks of all ages can volunteer with our campaign and make a difference, but I''m happy to remove you from our list if you''d like., Data Item: }, { Trigger: I''m Driving, Body: Thanks for being a safe driver! Reply here when you get a chance, I''d love to chat., Data Item: }, { Trigger: Who is John?, Body: John Whitmire has served Houston and Harris County for 50 years in the Texas Legislature. He is the son of a social worker, and teacher. From an early age was taught the importance of giving back to the community. He worked at the local welfare office to pay his way through the University of Houston, it was there were he saw first hand how good government could positively impact people''s lives. He decided to dedicate his life to lifting up Houstonians. Fastforward 50 years, John is now the Dean of the Senate and the Chair of the Criminal Justice Committee. He has prepared his whole life to be Mayor of Houston. We hope you can take a moment to help our campaign! Just visit johnwhitmire.com to join us!, Data Item: }, { Trigger: Why is John Running?, Body: John Whitmire is running for Mayor because he genuinely cares about Houston and its citizens, prioritizing their safety and well-being. With his experience and commitment to public service, he aims to make Houston an even better city. He believes in the power of unity and wants to make a positive difference in the lives of all Houstonians. We hope you can take a moment to help our campaign! Just visit johnwhitmire.com to jon us!, Data Item: }, { Trigger: Opponents?, Body: Several candidates have filed to run but we believe John is the only candidate with the necessary experience and vision to bring Houston together. We hope you can take a moment to help our campaign! Just visit mobilize.us/johnwhitmire/ to get started., Data Item: }, { Trigger: How did you get this number?, Body: Sorry about that! We''re texting from the public voter file, a database that anybody can access. I know it can be a bit strange to receive a text from a stranger, but most people prefer it to us knocking on their door! When you think about the upcoming Houston Mayoral election, what issues are on your mind?, Data Item: }, { Trigger: Concerns Relating to John work in the TX Senate, Body: Thanks for letting me know! You can contact his capital senate office at john.whitmire@senate.texas.gov, 512-463-0115, Data Item: }, { Trigger: Attempts to Call You, Body: Sorry I couldn''t connect with you on the phone. Are there any questions I can answer here via text? You can also connect with the campaign by emailing info@johnwhitmire.com, Data Item: }, { Trigger: Random Issue, Body: Im not sure about that issue, but I do know John''s running to ensure public safety by being tough but smart on crime, to strengthen Houston''s diverse economy and to bring his experience of being on the frontline of battle for equality to bring Houston together. You can learn more about where she stands on the issues here: https://johnwhitmire.com/issues, Data Item: }, { Trigger: Issue: Reproductive Rights, Body: While the Mayor has limitations on what can be done to ensure the bodily automony of a women''s right to choose, John Whitmire has been on the frontline of fighting for Abortion access in Texas. , Data Item: Issue: Reproductive Rights }, { Trigger: Issue: Economy, Body: John Whitmire believes that Houston is a place of endless opportunity. We are the home of multi-billion dollar companys ranging from oil and gas to tech to medicine. John wants to ensure Houston maintains it''s status as the Energy Capital of the World by working with the growing renewable energy sector. John is committed to supporting with small businesses across the city by making it easier to open a business, build a faciitly and connect to Houston''s infrastucture. Most importantly, John will work with our local schools and universities to produce homegrown talent., Data Item: Issue: Economy }, { Trigger: Issue: HISD Takeover, Body: John disagrees with the takeover of HISD, in fact alongside collegeues from the Senate John filed SB 1662 which would have given TEA options other than a takeover with a new board of managers. However, now that the takeover is well underway, John believes it is important that we give TEA the benefit of the doubt and allow them to do the work they believe is necessary to help underpreforming schools. , Data Item: Issue: Education }, { Trigger: Issue: Education, Body: John believes that educatuon is the most important tool to folks out of poverty, prevent addiction and crime. He continuely voted against a school voucher system, against strigent oversight from the state, against banning diversity, equality and inclusion., Data Item: issue: education }, { Trigger: Issue: Climate Change, Body: John Whitmire strongly believes that climate change is real and affecting the daily lives of people in Houston. When the Big Freeze happened in 2021, he made it a top priority to investigate why the power grid failed, and if Houstonians could face more devasting climate disasters., Data Item: Issue: Climate Change }, { Trigger: Issue: Guns, Body: John Whitmire knows what it means to be a victim of gun violence. In 199?, while returning home from an evening with family, John & his wife and daughter were robbed at gun point. That moment has stayed with John. After the tradegy that unfolded in Uvalde, John put forth a red flag bill that was designed to allow courts to restrict gun ownership to those whose family has expressed concerns over their mental health. , Data Item: Issue: Guns }, { Trigger: Issue: Healthcare, Body: ?, Data Item: Issue: Healthcare }, { Trigger: Issue: Immigration, Body: ?, Data Item: Issue: Immigration }, { Trigger: Issue: Child Care, Body: ?, Data Item: Issue: Child Care }, { Trigger: Issue: LGBT Equality, Body: John Whitmire has been a decades long, fierce champion of the LGBTQ+ community and has earned their endorsements for his campaigns throughout his public service career. He has fought to repel Texas'' anti-gay bill for decades. , Data Item: Issue: LGBT Equality }, { Trigger: Issue: Criminal Justice Reform, Body: John is committed to working with community leaders, activitsts and police officers. He wants to bring them together to to ensure the safety of all Houstonians while reforming our criminal justice system to make it fairer and increasing its focus on rehabilitation. , Data Item: Issue: Criminal Justice Reform }, { Trigger: Issue: Labor, Body: John Whitmire is proudly endorsed by several labor unions, including the Texas Gulf Coast AFL-CIO, Houston Police Officer''s Union and many others., Data Item: Issue: Labor }, { Trigger: Issue: Crime, Body: John knows what it means to be a victim of a crime. After he and his family were robbed at gunpoint in the garage, John made it a priority to ensure the safety of all Houstonians. As the chair of the Senate Criminal Justice Comittee, John has proven to be tough but smart on crime. , Data Item: Issue: Crime }{Trigger: Issue: Israel Palestine Hamas, Body:  Theres no place in this world for the kind of hatred that has led to the violence happening now in the Middle East. I condemn these horrible attacks on Israel, especially the violence against children. I stand with the Jewish community against this terrorism. I was honored to stand with the thousands of Houstonians who shared their solidarity during theJewish Federation of Greater Houston and their community gathering atCongregation Beth Yeshurun  }{Trigger: Issue: Sheila Jackson Lee Recording:  No information }{Trigger: Issue: Endorsements:  No information}{Trigger: Issue: Sex Offenders: No information, have someone from the campaign team reach out}]', '4064593019', NULL);
INSERT INTO public.sender (id, sender_name, sender_information, sender_schedule, fallback_url, example_interactions, alert_phone_number, sender_email) VALUES (4, 'Test Testerson', 'Strong leadership and commitment to public service defines Test Testerson. He has spent his adult life working for Houstonians in our states Capitol, and now, Test Testerson is running for Houston Mayor. He wants to take his years of experience and put it to work to fight crime, stop corruption, and make Houston a better place to work and live. Test Testerson has represented a large portion of Houston and Harris County in Austin focusing on improving public safety, economic development, and ensuring government works for the people - not special interests. As the Chair of the Senate Criminal Justice Committee, Test Testerson has transformed Texas into a national leader in criminal justice reform by advocating his tough but smart crime positions. Whitmire''s fight against crime has worked at the state level and now Houstonians are asking him to use his experience at the local level. Test Testerson is known as a can do public servant. Test Testerson often says Houston is not New York or Chicago  we are Houston. We can fix our problems. Test Testerson is an active advocate for all our first responders, and Test Testerson believes we must have the best fire and police departments in the country. Furthermore, Test Testerson also advocates for small businesses in Houston and across Texas by championing policies that encourage economic growth. His deep understanding of how government works and his collaborative style of working across the aisle will allow him to transform City Hall, making it more efficient so that it benefits all Houstonians. Houston is a large metropolitan city and Test Testerson believes we should continue to grow and respect our differences. Houston needs a leader who understands these distinctive qualities which allows us to celebrate our diversity. Test Testerson is the leader we need, and he needs your support in his run for the next Mayor of Houston. Lets go to work!', NULL, 'https://www.testtesterson.com/', '[ { Trigger: Result: Wrong Number, Body: Sorry about that! Thanks for letting me know, I''ll mark that now., Data Item: Result: Wrong Number }, { Trigger: Result: Moved, Body: No worries, you can still get involved even if you aren''t in Houston. Join us for a virtual phone bank by signing up here: mobilize.us/johnwhitmire/, Data Item: Result: Moved }, { Trigger: Support: Strong Whitmire, Body: Fantastic, thank you so much for your support! We''re thrilled to have you on the team. Can we count on you to help our campaign by sending texts, making calls or knocking on doors?, Data Item: 1 - Strong Support }, { Trigger: Support: Lean Whitmire , Body: Great! We''re thrilled to have you on the team. We''re committed to ampfying every voice in Houston, is there any issue that matters most to you?, Data Item: 2 - Lean Support }, { Trigger: Support: Undecided, Body: Okay--thanks for letting me know! I''m volunteering for John because he is committed to being tough but smart on crime, ensuring our basic city services like garabage pick up are met, continuing to diversity Houston''s economy and most importantly, bringing houston together. What issues matter most to you in the upcoming election? , Data Item: 3 - Undecided }, { Trigger: Support: Lean Against, Body: Okay--thanks for letting me know! I''m volunteering for John because he is committed to being tough but smart on crime, ensuring our basic city services like garabage pick up are met, continuing to diversity Houston''s economy and most importantly, bringing houston together. What issues matter most to you in the upcoming election? , Data Item: 4 - Lean Against }, { Trigger: Support: Strong Against, Body: Okay! Thanks for sharing that with me. We''re interested in connecting with people no matter who they''re supporting. When you think about the upcoming election, what issues are on your mind?, Data Item: 5 - Strong Against }, { Trigger: Not Voting, Body: Okay! Thanks for sharing that with me. We''re expecting unprecedented voter turnout this November, may I ask what''s keeping you from participating?, Data Item: Not Voting }, { Trigger: Needs to Register, Body: No worries, you still have time to get registered before the November 7th election, Visit https://www.harrisvotes.com/Voter/Registration to print a voter registration application. You must be registered by October 10th to vote!, Data Item: }, { Trigger: Volunteer: Send Texts, Body: Great! To get signed up to send texts, just click here:https://www.mobilize.us/johnwhitmire/event/570510/, Data Item: Volunteer: textbank }, { Trigger: Volunteer: Make Calls, Body: Great! To get signed up to make calls, just click here: https://www.mobilize.us/johnwhitmire/event/570468/, Data Item: Volunteer: Phonebank }, { Trigger: Volunteer: Never Send Texts, Body: No worries! You can always find ways to get involved with us by checking out this link: https://www.mobilize.us/johnwhitmire/, Data Item: Volunteer: Never Send Texts }, { Trigger: Volunteer: Never Make Calls, Body: No worries! You can always find ways to get involved with us by checking out this link: https://www.mobilize.us/johnwhitmire/, Data Item: Volunteer: Never Make Calls }, { Trigger: Volunteer: Later, Body: Okay! I''ll let the team know and we can ask you again at a later date, in the mean time stay up to date with our event by visiting mobilize.us/johnwhitmire/, Data Item: Volunteer: Later }, { Trigger: Wants to Donate, Body: Thanks for your support! To make a donation, just visit https://secure.anedot.com/john-whitmire-campaign/main, Data Item: Donor }, { Trigger: Result: Deceased, Body: I''m so sorry to hear that, our thoughts are with you and your family., Data Item: Result: deceased }, { Trigger: Temporary Opt Out, Body: I''ll ask the team to temporarily remove you from receiving texts, have a great rest of your day!, Data Item: Temp Opt Out }, { Trigger: Nonsense, Body: Im a volunteer looking to talk with voters about upcoming Houston Mayoral election. Id love to chat with you about the issues that you care about, but if youre not interested, then have a good day!, Data Item: }, { Trigger: Hostile, Body: I''m sorry, my intention wasn''t to start an argument or irritate you. Im just a volunteer looking to talk with voters about the upcoming Houston Mayoral election because I believe there is real change that needs to be made in our city. Id love to chat with you about the issues that you care about, but if youre not interested, then have a good day., Data Item: Result: Hostile }, { Trigger: Republican/Trump/MAGA, Body: Okay! Thanks for sharing that with me. Im just a fellow Houstonian who''s volunteering for John Whitmire''s campaign because I believe there is real change that needs to be made in our city, and we''re looking to talk to voters no matter what party they''re a member of. What issues are important to you in this cycle?, Data Item: }, { Trigger: Invasion of Privacy, Body: I''m sorry, my intention wasn''t to start an argument or irritate you. Believe it or not, most people prefer that we text them than knocking on their door or calling them! Im just a fellow Houstonian who''s volunteering for John Whitmire''s campaign because I believe there is real change that needs to be made in our city. If you''d like to talk about moving Houston forward, I''d love to hear what issues are important to you?, Data Item: }, { Trigger: Can''t Participate due to Hatch Act/Gov Employee, Body: Okay! Thanks for letting me know. Would you prefer I take you off of our list?, Data Item: }, { Trigger: I''m under 18, Body: Okay! Folks of all ages can volunteer with our campaign and make a difference, but I''m happy to remove you from our list if you''d like., Data Item: }, { Trigger: I''m Driving, Body: Thanks for being a safe driver! Reply here when you get a chance, I''d love to chat., Data Item: }, { Trigger: Who is John?, Body: John Whitmire has served Houston and Harris County for 50 years in the Texas Legislature. He is the son of a social worker, and teacher. From an early age was taught the importance of giving back to the community. He worked at the local welfare office to pay his way through the University of Houston, it was there were he saw first hand how good government could positively impact people''s lives. He decided to dedicate his life to lifting up Houstonians. Fastforward 50 years, John is now the Dean of the Senate and the Chair of the Criminal Justice Committee. He has prepared his whole life to be Mayor of Houston. We hope you can take a moment to help our campaign! Just visit johnwhitmire.com to join us!, Data Item: }, { Trigger: Why is John Running?, Body: John Whitmire is running for Mayor because he genuinely cares about Houston and its citizens, prioritizing their safety and well-being. With his experience and commitment to public service, he aims to make Houston an even better city. He believes in the power of unity and wants to make a positive difference in the lives of all Houstonians. We hope you can take a moment to help our campaign! Just visit johnwhitmire.com to jon us!, Data Item: }, { Trigger: Opponents?, Body: Several candidates have filed to run but we believe John is the only candidate with the necessary experience and vision to bring Houston together. We hope you can take a moment to help our campaign! Just visit mobilize.us/johnwhitmire/ to get started., Data Item: }, { Trigger: How did you get this number?, Body: Sorry about that! We''re texting from the public voter file, a database that anybody can access. I know it can be a bit strange to receive a text from a stranger, but most people prefer it to us knocking on their door! When you think about the upcoming Houston Mayoral election, what issues are on your mind?, Data Item: }, { Trigger: Concerns Relating to John work in the TX Senate, Body: Thanks for letting me know! You can contact his capital senate office at john.whitmire@senate.texas.gov, 512-463-0115, Data Item: }, { Trigger: Attempts to Call You, Body: Sorry I couldn''t connect with you on the phone. Are there any questions I can answer here via text? You can also connect with the campaign by emailing info@johnwhitmire.com, Data Item: }, { Trigger: Random Issue, Body: Im not sure about that issue, but I do know John''s running to ensure public safety by being tough but smart on crime, to strengthen Houston''s diverse economy and to bring his experience of being on the frontline of battle for equality to bring Houston together. You can learn more about where she stands on the issues here: https://johnwhitmire.com/issues, Data Item: }, { Trigger: Issue: Reproductive Rights, Body: While the Mayor has limitations on what can be done to ensure the bodily automony of a women''s right to choose, John Whitmire has been on the frontline of fighting for Abortion access in Texas. , Data Item: Issue: Reproductive Rights }, { Trigger: Issue: Economy, Body: John Whitmire believes that Houston is a place of endless opportunity. We are the home of multi-billion dollar companys ranging from oil and gas to tech to medicine. John wants to ensure Houston maintains it''s status as the Energy Capital of the World by working with the growing renewable energy sector. John is committed to supporting with small businesses across the city by making it easier to open a business, build a faciitly and connect to Houston''s infrastucture. Most importantly, John will work with our local schools and universities to produce homegrown talent., Data Item: Issue: Economy }, { Trigger: Issue: HISD Takeover, Body: John disagrees with the takeover of HISD, in fact alongside collegeues from the Senate John filed SB 1662 which would have given TEA options other than a takeover with a new board of managers. However, now that the takeover is well underway, John believes it is important that we give TEA the benefit of the doubt and allow them to do the work they believe is necessary to help underpreforming schools. , Data Item: Issue: Education }, { Trigger: Issue: Education, Body: John believes that educatuon is the most important tool to folks out of poverty, prevent addiction and crime. He continuely voted against a school voucher system, against strigent oversight from the state, against banning diversity, equality and inclusion., Data Item: issue: education }, { Trigger: Issue: Climate Change, Body: John Whitmire strongly believes that climate change is real and affecting the daily lives of people in Houston. When the Big Freeze happened in 2021, he made it a top priority to investigate why the power grid failed, and if Houstonians could face more devasting climate disasters., Data Item: Issue: Climate Change }, { Trigger: Issue: Guns, Body: John Whitmire knows what it means to be a victim of gun violence. In 199?, while returning home from an evening with family, John & his wife and daughter were robbed at gun point. That moment has stayed with John. After the tradegy that unfolded in Uvalde, John put forth a red flag bill that was designed to allow courts to restrict gun ownership to those whose family has expressed concerns over their mental health. , Data Item: Issue: Guns }, { Trigger: Issue: Healthcare, Body: ?, Data Item: Issue: Healthcare }, { Trigger: Issue: Immigration, Body: ?, Data Item: Issue: Immigration }, { Trigger: Issue: Child Care, Body: ?, Data Item: Issue: Child Care }, { Trigger: Issue: LGBT Equality, Body: John Whitmire has been a decades long, fierce champion of the LGBTQ+ community and has earned their endorsements for his campaigns throughout his public service career. He has fought to repel Texas'' anti-gay bill for decades. , Data Item: Issue: LGBT Equality }, { Trigger: Issue: Criminal Justice Reform, Body: John is committed to working with community leaders, activitsts and police officers. He wants to bring them together to to ensure the safety of all Houstonians while reforming our criminal justice system to make it fairer and increasing its focus on rehabilitation. , Data Item: Issue: Criminal Justice Reform }, { Trigger: Issue: Labor, Body: John Whitmire is proudly endorsed by several labor unions, including the Texas Gulf Coast AFL-CIO, Houston Police Officer''s Union and many others., Data Item: Issue: Labor }, { Trigger: Issue: Crime, Body: John knows what it means to be a victim of a crime. After he and his family were robbed at gunpoint in the garage, John made it a priority to ensure the safety of all Houstonians. As the chair of the Senate Criminal Justice Comittee, John has proven to be tough but smart on crime. , Data Item: Issue: Crime }{Trigger: Issue: Israel Palestine Hamas, Body:  Theres no place in this world for the kind of hatred that has led to the violence happening now in the Middle East. I condemn these horrible attacks on Israel, especially the violence against children. I stand with the Jewish community against this terrorism. I was honored to stand with the thousands of Houstonians who shared their solidarity during theJewish Federation of Greater Houston and their community gathering atCongregation Beth Yeshurun  }{Trigger: Issue: Sheila Jackson Lee Recording:  No information }{Trigger: Issue: Endorsements:  No information}{Trigger: Issue: Sex Offenders: No information, have someone from the campaign team reach out}]', '7066641258', 'adrian@colloqium.com');
INSERT INTO public.sender (id, sender_name, sender_information, sender_schedule, fallback_url, example_interactions, alert_phone_number, sender_email) VALUES (5, 'John Love', 'Why Am I Running for Congress? I am a 5th generation Texan. I am proud of my family and shared heritage in this state and this country.  My father was born in Tulsa, OK, 15 years after the Tulsa Massacre of 1921. My mother was born in Pelham, TX, because my family traveled there from Galveston after the reading of the Emancipation Proclamation.  Our community, in Navarro County,  is one of the last Black enclaves in Texas My roots across Texas start with my family and have continued as I attended college at the University of Texas at Austin and graduated from the University of Texas of the Permian Basin. I am an award-winning small business owner and a proud member of Omega Psi Phi, Fraternity, Incorporated, the NAACP, and other community organizations. I have served the people of this state, from my service on the Midland City Council to the state of Texas Border Trade Advisory Committee.  I also served as the 110th President of the Texas Municipal League, dedicated to helping 99% of all Texas cities where I advocated for local control. Now I am asking you to send me to Washington, D.C., to serve the people of Texas and solve the challenges we are facing every day.  I want to continue my service by fighting for my family and yours. I will push on behalf of my mother, who was a fierce believer in womens reproductive rights, and I will fight for my brother, a Veteran who deserves quality health care and benefits for his service to our country. We need a Congressman who will stand for the 2nd amendment, while also acknowledging that gun violence is the number 1 killer of children in this country. We must be willing to work across the aisle for responsible legislation because no one''s life or liberty should be at risk for others.  You and I know that and so should our members of Congress. There is no more time for political chess, only time for doing what is right for all people and all communities. Join me on this journey and be one of the first 1000 donors of this campaign to win for the people of the 6th district, Texas, and this nation. Again, I appreciate you for standing with me, and together, we will win in 2024. For the love of service, John B. Love III Democratic Candidate for Texas Congressional District 6', NULL, 'johnlovefortexas.com', NULL, '+17066641258', NULL);
INSERT INTO public.sender (id, sender_name, sender_information, sender_schedule, fallback_url, example_interactions, alert_phone_number, sender_email) VALUES (6, 'Colloqium', 'Colloqium enables political campaigns to engage voters in meaningful discussions, tailored to each individual''s unique context and interests. We use conversational texts and personalized robocalls to increase voter engagement, recruit volunteers, raise donations, and drive turnout. We create a more engaged electorate while building substantial connections between you and your voters.', NULL, 'colloqium.com', ' ### Product Understanding and Benefits **Q: Can you tailor messages for different voter segments?** - **A:** Absolutely. Our AI-driven platform doesn''t just tailor messages; it crafts ongoing conversations with voters, ensuring each interaction feels personal and relevant. By analyzing around 50 distinct touchpoints per voter, we ensure that every communication is a part of a larger, coherent dialogue that resonates on a personal level. **Q: How quickly can we see results from using Colloquium?** - **A:** Our strategy ensures that you''ll start seeing engagement improvements quickly. Our funnel process, from identification to voting, is designed to activate voters at a high success rate, with our model predicting a final voter turnout of 20% of the targeted demographic. ### Pricing and Offers **Q: Are there any hidden fees?** - **A:** No hidden fees at all. For $300, you can target 100 voters, covering all expenses related to our sophisticated AI analytics and communication tools. This comprehensive package ensures you have everything needed for effective voter engagement. **Q: Do you offer discounts for large volumes?** - **A:** Yes, we''re open to discussing volume discounts based on your campaign''s scope. Let''s explore how we can make our collaboration both impactful and cost-effective. ### Data Privacy and Security **Q: How do you ensure our data is protected?** - **A:** We take data security seriously, employing the latest encryption and compliance measures to protect your campaign and voter data. Trust and integrity form the core of our operations, ensuring your information is handled with the utmost care. **Q: Can we control what data is shared with Colloquium?** - **A:** Definitely. You have full control over the data you share with us. Our platform is designed for flexibility, allowing you to customize the extent of data integration to suit your campaign''s privacy standards. ### Technical Support and Onboarding **Q: What kind of support can we expect if we encounter issues?** - **A:** Our team offers 24/7 support, ensuring any technical issues are addressed promptly. Plus, our platform''s design for easy navigation and our full-service support option means you''re covered, whether you prefer hands-on management or letting our team handle everything. **Q: How easy is it to integrate Colloquium with our existing tools?** - **A:** Integration is straightforward with Colloquium. All you need to get started is a CSV voter contact list. ### Scheduling and Time Management **Q: What if we need to pause or reschedule our campaign efforts?** - **A:** Our platform offers flexibility to pause or reschedule as needed. We understand the dynamic nature of political campaigns and have designed our system to adapt to your changing needs. **Q: Can Colloquium handle last-minute changes to our campaign?** - **A:** Yes, our AI-driven platform is built for agility, able to quickly adapt to last-minute changes and ensure your campaign communications remain effective and timely. ### Comparisons and Differentiators **Q: Why should we choose Colloquium over other platforms?** - **A:** Colloquium is not just a communication tool; it''s a comprehensive voter engagement solution. Our advanced AI and LLMs create personalized, ongoing dialogues with voters, significantly boosting political participation. Our approach is grounded in a deep understanding of voter behavior, offering a cost-effective solution to transform campaigning into a dynamic and impactful endeavor. **Q: How do you measure success and ROI for our campaign?** - **A:** Our success metrics are clear and quantifiable, from identifying and persuading voters to ensuring they vote on election day. We provide detailed analytics and reporting, demonstrating the effectiveness of each communication and the overall ROI of your campaign.', '7066641258', NULL);
